    Vincent National Wildlife Refuge discusses refuge establishment and management,
    future refuge management, the contribution of the refuge to national ecosystems,
    conservation and recovery plans, and objectives for meeting resource needs.  Objectives
    for waterfowl, shorebirds, colonial waterbirds, land acquisition, animal control,
    public use, noxious plant control, water control, wetland management, contaminants,
    fisheries management, reptiles and amphibians, prescribed fire, monitoring, law
